require_relative '../../test_helper'

class UPSTest < Test::Unit::TestCase
  def setup
    @packages = TestFixtures.packages
    @locations = TestFixtures.locations
    @carrier = UPS.new(
          :key => 'key',
          :login => 'login',
          :password => 'password'
    )
    @tracking_response = xml_fixture('ups/shipment_from_tiger_direct')

    @confirmation_request_options = TestFixtures.confirmation_request_options
    @acceptance_request_options = TestFixtures.acceptance_request_options
    @void_request_options = TestFixtures.void_request_options
    @address_validation_request_options = TestFixtures.address_validation_request_options
  end

  def remove_human_spaces_from_xml(xml)
    xml.gsub(/>\s*\n/, ">\n").gsub(/\n\s*</, '<')
  end

  def test_initialize_options_requirements
    assert_raises(ArgumentError) { UPS.new }
    assert_raises(ArgumentError) { UPS.new(:login => 'blah', :password => 'bloo') }
    assert_raises(ArgumentError) { UPS.new(:login => 'blah', :key => 'kee') }
    assert_raises(ArgumentError) { UPS.new(:password => 'bloo', :key => 'kee') }
    assert_nothing_raised { UPS.new(:login => 'blah', :password => 'bloo', :key => 'kee') }
  end

  def test_find_tracking_info_should_return_a_tracking_response
    @carrier.expects(:commit).returns(@tracking_response)
    assert_equal 'ActiveMerchant::Shipping::TrackingResponse', @carrier.find_tracking_info('1Z5FX0076803466397').class.name
  end

  def test_find_tracking_info_should_parse_response_into_correct_number_of_shipment_events
    @carrier.expects(:commit).returns(@tracking_response)
    response = @carrier.find_tracking_info('1Z5FX0076803466397')
    assert_equal 8, response.shipment_events.size
  end

  def test_find_tracking_info_should_return_shipment_events_in_ascending_chronological_order
    @carrier.expects(:commit).returns(@tracking_response)
    response = @carrier.find_tracking_info('1Z5FX0076803466397')
    assert_equal response.shipment_events.map(&:time).sort, response.shipment_events.map(&:time)
  end

  def test_find_tracking_info_should_have_correct_names_for_shipment_events
    @carrier.expects(:commit).returns(@tracking_response)
    response = @carrier.find_tracking_info('1Z5FX0076803466397')
    assert_equal ["BILLING INFORMATION RECEIVED",
                  "IMPORT SCAN",
                  "LOCATION SCAN",
                  "LOCATION SCAN",
                  "DEPARTURE SCAN",
                  "ARRIVAL SCAN",
                  "OUT FOR DELIVERY",
                  "DELIVERED"], response.shipment_events.map(&:name)
  end

  def test_add_origin_and_destination_data_to_shipment_events_where_appropriate
    @carrier.expects(:commit).returns(@tracking_response)
    response = @carrier.find_tracking_info('1Z5FX0076803466397')
    assert_equal '175 AMBASSADOR', response.shipment_events.first.location.address1
    assert_equal 'K1N5X8', response.shipment_events.last.location.postal_code
  end

  def test_response_parsing
    mock_response = xml_fixture('ups/test_real_home_as_residential_destination_response')
    @carrier.expects(:commit).returns(mock_response)
    response = @carrier.find_rates(@locations[:beverly_hills],
                                   @locations[:real_home_as_residential],
                                   @packages.values_at(:chocolate_stuff))
    assert_equal ["UPS Ground",
                  "UPS Three-Day Select",
                  "UPS Second Day Air",
                  "UPS Next Day Air Saver",
                  "UPS Next Day Air Early A.M.",
                  "UPS Next Day Air"], response.rates.map(&:service_name)
    assert_equal [992, 2191, 3007, 5509, 9401, 6124], response.rates.map(&:price)

    date_test = [nil, 3, 2, 1, 1, 1].map do |days|
      DateTime.strptime(days.days.from_now.strftime("%Y-%m-%d"), "%Y-%m-%d") if days
    end

    assert_equal date_test, response.rates.map(&:delivery_date)
  end

  def test_maximum_weight
    assert Package.new(150 * 16, [5, 5, 5], :units => :imperial).mass == @carrier.maximum_weight
    assert Package.new((150 * 16) + 0.01, [5, 5, 5], :units => :imperial).mass > @carrier.maximum_weight
    assert Package.new((150 * 16) - 0.01, [5, 5, 5], :units => :imperial).mass < @carrier.maximum_weight
  end


  def test_build_confirmation_request
    confirmation_request = remove_human_spaces_from_xml(xml_fixture('ups/shipment_confirm_request'))
    assert_equal confirmation_request, @carrier.send(:build_confirmation_request, @confirmation_request_options)
  end

  def test_build_confirmation_request_dry_ice
    confirmation_request = remove_human_spaces_from_xml(xml_fixture('ups/shipment_confirm_request_dry_ice'))
    assert_equal confirmation_request, @carrier.send(:build_confirmation_request,
                                                     TestFixtures.confirmation_request_options(
                                                       account_number = '123456', [@packages[:perishable_wii]]))
  end

  def test_build_confirmation_request_without_package_values
    confirmation_request = remove_human_spaces_from_xml(xml_fixture('ups/shipment_confirm_request_no_package_value'))
    packages = [@packages[:valueless_wii]]
    request_options = TestFixtures.confirmation_request_options(account_number = '123456', packages)

    assert_equal confirmation_request, @carrier.send(:build_confirmation_request, request_options)
  end

  def test_parse_confirmation_response
    confirm_response = xml_fixture('ups/shipment_confirm_response_real')

    parsed_response = @carrier.send(:parse_confirmation_response, confirm_response)
    assert_equal 'ActiveMerchant::Shipping::ConfirmationResponse', parsed_response.class.name
    assert_equal true, parsed_response.success?
    assert_equal 61.64, parsed_response.total_cost
    assert_equal '1Z9196170295025216', parsed_response.shipment_identification_number
    assert_equal confirm_response, parsed_response.xml_response

    expected_shipment_digest = ''
    assert_equal expected_shipment_digest, parsed_response.shipment_digest
  end

  def test_shipment_confirm_request_should_return_a_response
    @carrier.expects(:commit).returns(xml_fixture('ups/shipment_confirm_response_real'))

    confirmation_response = @carrier.get_confirmation_response(@confirmation_request_options)
    assert_equal 'ActiveMerchant::Shipping::ConfirmationResponse', confirmation_response.class.name
    assert_equal true, confirmation_response.success?
  end

  def test_build_acceptance_request
    acceptance_request = remove_human_spaces_from_xml(xml_fixture('ups/shipment_accept_request'))
    assert_equal acceptance_request, @carrier.send(:build_acceptance_request, @acceptance_request_options)
  end

  def test_parse_acceptance_response
    acceptance_response = xml_fixture('ups/shipment_accept_response_real')
    parsed_response = @carrier.send(:parse_acceptance_response, acceptance_response)
    assert_equal 'ActiveMerchant::Shipping::AcceptanceResponse', parsed_response.class.name
    assert_equal true, parsed_response.success?
    assert_equal 108.14, parsed_response.total_cost
    assert_equal '1Z9196170297067329', parsed_response.shipment_identification_number
    assert_equal 2, parsed_response.packages.size
    assert_equal '1Z9196170297067329', parsed_response.packages.first[:tracking_number]
    assert_equal '1Z9196170295190136', parsed_response.packages.second[:tracking_number]
    assert_equal acceptance_response, parsed_response.xml_response

    expected_image_data_1 = Base64.decode64('')
    expected_image_data_2 = Base64.decode64('')
    assert_equal expected_image_data_1, parsed_response.packages.first[:image_data]
    assert_equal expected_image_data_2, parsed_response.packages.second[:image_data]

    expected_label_html_1 = Base64.decode64('')
    expected_label_html_2 = Base64.decode64('')
    assert_equal expected_label_html_1, parsed_response.packages.first[:label_html]
    assert_equal expected_label_html_2, parsed_response.packages.second[:label_html]
  end

  def test_parse_acceptance_response_with_high_value_report
    acceptance_response = xml_fixture('ups/shipment_accept_response_real_high_value')
    parsed_response = @carrier.send(:parse_acceptance_response, acceptance_response)

    assert_equal true, parsed_response.success?
    expected_high_value_report = Base64.decode64('')
    assert_equal expected_high_value_report, parsed_response.high_value_report
  end

  def test_build_void_request_condensed
    void_request = remove_human_spaces_from_xml(xml_fixture('ups/void_request_condensed'))
    assert_equal void_request, @carrier.send(:build_void_request, @void_request_options[:condensed])
  end

  def test_build_void_request_expanded
    void_request = remove_human_spaces_from_xml(xml_fixture('ups/void_request_expanded'))
    assert_equal void_request, @carrier.send(:build_void_request, @void_request_options[:expanded])
  end

  def test_build_address_validation_request
    address_validation_request = remove_human_spaces_from_xml(xml_fixture('ups/address_validation_request'))
    assert_equal address_validation_request, @carrier.send(:build_address_validation_request, @address_validation_request_options)
  end
end